[asy]
import three;
real t=-0.05;
triple A,B,C,D,EE,F,G,H;
A = (0,0,0);
B = (cos(t),sin(t),0);
D= (-sin(t),cos(t),0);
C = B+D;
EE = (0,0,1);
F = B+EE;
G = C + EE;
H = D + EE;
